import React from 'react';
import Landing from "views/Lading.js";


class App extends React.Component {
  constructor(){
    super();
    this.state = {
      users: [], 
      searchText : ''
    }
}


//   //will render again after first render of mounting due to the setstate
  componentDidMount(){
    fetch("http://dataservice.accuweather.com/currentconditions/v1/topcities/group?apikey=MAjIj3A4LIsJqoNrDn74HNDnANduKaUw")
    .then(res => res.json())
    .then(data => {
      console.log(data);
    })
    .catch(err => {
      console.log(err);
    })
  }



  render() {
    return (
        <div>
            <Landing />
        </div>
  )
}


}
export default App;
